  return (
    <div className="container">
      <div class="d-flex justify-content-center">
          <div className="card loginCard">
              <div className="card-body">
              <div className="m-5 ">
          <MDBInput label="Your Username" group type="email" validate error="wrong"
            success="right" />
            <div className="m-5 ">
          <MDBInput label="Your Password" group type="password" validate error="wrong"
            success="right" />
            </div>
            </div>
            </div>
          </div>
      </div>
    </div>
  );
}
